import axios from 'axios';
import { apiEndpoint } from './apiConfig';

export async function getMove(board, player) {
  return await new Promise((resolve, reject) => {
    axios.get(`${apiEndpoint}/getMove`, {
      data: {
        board: board,
        player: player
      }
    }).then((response) => {
      resolve(response.data);
    })
  });
}
